PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE alembic_version (
	version_num VARCHAR(32) NOT NULL, 
	CONSTRAINT alembic_version_pkc PRIMARY KEY (version_num)
);
CREATE TABLE roles (
	id INTEGER NOT NULL, 
	name VARCHAR NOT NULL, 
	PRIMARY KEY (id), 
	UNIQUE (name)
);
CREATE TABLE users (
	id INTEGER NOT NULL, 
	first_name VARCHAR NOT NULL, 
	last_name VARCHAR NOT NULL, 
	birth_date DATE NOT NULL, 
	login VARCHAR NOT NULL, 
	phone VARCHAR NOT NULL, 
	email VARCHAR NOT NULL, 
	company VARCHAR NOT NULL, 
	work_start_time TIME, 
	work_end_time TIME, 
	work_days JSON NOT NULL, 
	role_id INTEGER, 
	hashed_password VARCHAR NOT NULL, 
	background_theme VARCHAR, 
	reg_date DATETIME, 
	last_login DATETIME, 
	PRIMARY KEY (id), 
	FOREIGN KEY(role_id) REFERENCES roles (id), 
	UNIQUE (email), 
	UNIQUE (login)
);
CREATE TABLE accesses (
	id INTEGER NOT NULL, 
	resource VARCHAR NOT NULL, 
	permission VARCHAR NOT NULL, 
	role_id INTEGER, 
	user_id INTEGER, 
	PRIMARY KEY (id), 
	FOREIGN KEY(role_id) REFERENCES roles (id), 
	FOREIGN KEY(user_id) REFERENCES users (id)
);
CREATE TABLE attendances (
	id INTEGER NOT NULL, 
	user_id INTEGER NOT NULL, 
	date DATE NOT NULL, 
	check_in TIME, 
	check_out TIME, 
	status VARCHAR, 
	PRIMARY KEY (id), 
	FOREIGN KEY(user_id) REFERENCES users (id)
);
CREATE TABLE comments (
	id INTEGER NOT NULL, 
	text TEXT NOT NULL, 
	is_internal BOOLEAN, 
	created_at DATETIME, 
	updated_at DATETIME, 
	lead_id INTEGER, 
	author_id INTEGER, 
	PRIMARY KEY (id), 
	FOREIGN KEY(author_id) REFERENCES users (id), 
	FOREIGN KEY(lead_id) REFERENCES leads_prototype (id)
);
CREATE TABLE installment_payments (
	id INTEGER NOT NULL, 
	lead_id INTEGER NOT NULL, 
	amount FLOAT NOT NULL, 
	due_date DATETIME NOT NULL, 
	payment_number INTEGER NOT NULL, 
	total_payments INTEGER NOT NULL, 
	status VARCHAR(9) NOT NULL, 
	created_at DATETIME, updated_at DATETIME, 
	PRIMARY KEY (id), 
	FOREIGN KEY(lead_id) REFERENCES leads_prototype (id)
);
CREATE TABLE payments (
	id INTEGER NOT NULL, 
	lead_id INTEGER NOT NULL, 
	amount FLOAT NOT NULL, 
	payment_type VARCHAR(11) NOT NULL, 
	due_date DATETIME NOT NULL, 
	description VARCHAR, 
	status VARCHAR(9) NOT NULL, 
	created_at DATETIME, updated_at DATETIME, 
	PRIMARY KEY (id), 
	FOREIGN KEY(lead_id) REFERENCES leads_prototype (id)
);
CREATE TABLE transactions (
	id INTEGER NOT NULL, 
	lead_id INTEGER NOT NULL, 
	payment_id INTEGER NOT NULL, 
	amount FLOAT NOT NULL, 
	payment_date DATETIME NOT NULL, 
	status VARCHAR(9) NOT NULL, 
	description VARCHAR, 
	created_at DATETIME, updated_at DATETIME, 
	PRIMARY KEY (id), 
	FOREIGN KEY(lead_id) REFERENCES leads_prototype (id), 
	FOREIGN KEY(payment_id) REFERENCES payments (id)
);
CREATE TABLE IF NOT EXISTS "check_photos" (
	id INTEGER NOT NULL, 
	created_at DATETIME, 
	expense_id INTEGER NOT NULL, 
	photo_path VARCHAR NOT NULL, 
	PRIMARY KEY (id), 
	CONSTRAINT fk_check_photos_expense_id_expenses FOREIGN KEY(expense_id) REFERENCES expenses (id)
);
CREATE TABLE contracts (
	id INTEGER NOT NULL, 
	lead_id INTEGER NOT NULL, 
	contract_number VARCHAR NOT NULL, 
	signing_date DATETIME NOT NULL, 
	terms VARCHAR NOT NULL, 
	status VARCHAR NOT NULL, 
	created_at DATETIME, 
	PRIMARY KEY (id), 
	FOREIGN KEY(lead_id) REFERENCES leads_prototype (id), 
	UNIQUE (contract_number)
);
CREATE TABLE IF NOT EXISTS "callbacks" (
	id INTEGER NOT NULL, 
	lead_id INTEGER NOT NULL, 
	callback_time DATETIME NOT NULL, 
	is_completed BOOLEAN NOT NULL, 
	created_at DATETIME, 
	is_missed BOOLEAN DEFAULT '0' NOT NULL, 
	confirmation_file VARCHAR, 
	confirmation_note VARCHAR, 
	PRIMARY KEY (id), 
	FOREIGN KEY(lead_id) REFERENCES leads_prototype (id)
);
CREATE TABLE IF NOT EXISTS "expenses" (
	id INTEGER NOT NULL, 
	title VARCHAR NOT NULL, 
	amount FLOAT NOT NULL, 
	description VARCHAR, 
	status VARCHAR(9) NOT NULL, 
	payment_date DATETIME NOT NULL, 
	created_at DATETIME, 
	created_by INTEGER NOT NULL, 
	updated_at DATETIME, 
	category VARCHAR(9) NOT NULL, 
	PRIMARY KEY (id), 
	FOREIGN KEY(created_by) REFERENCES users (id)
);
CREATE TABLE price_history (
	id INTEGER NOT NULL, 
	floor INTEGER NOT NULL, 
	unit_size FLOAT NOT NULL, 
	price FLOAT NOT NULL, 
	recorded_at DATETIME NOT NULL, 
	PRIMARY KEY (id)
);
CREATE TABLE IF NOT EXISTS "leads_prototype" (
	id INTEGER NOT NULL, 
	full_name VARCHAR NOT NULL, 
	phone VARCHAR NOT NULL, 
	region VARCHAR NOT NULL, 
	contact_source VARCHAR NOT NULL, 
	status VARCHAR(4) NOT NULL, 
	state VARCHAR(16) NOT NULL, 
	square_meters FLOAT, 
	rooms INTEGER, 
	floor INTEGER, 
	total_price FLOAT NOT NULL, 
	currency VARCHAR NOT NULL, 
	payment_type VARCHAR NOT NULL, 
	monthly_payment FLOAT, 
	installment_period INTEGER, 
	installment_markup FLOAT, 
	created_at DATETIME, 
	updated_at DATETIME, 
	user_id INTEGER, 
	notes VARCHAR, 
	next_contact_date DATETIME, 
	complex_name VARCHAR, 
	number_apartments INTEGER, 
	block VARCHAR, 
	down_payment FLOAT, 
	square_meters_price FLOAT, 
	down_payment_percent VARCHAR, 
	is_active BOOLEAN DEFAULT 1 NOT NULL, 
	deleted_at DATETIME, hybrid_final_payment FLOAT, 
	PRIMARY KEY (id), 
	FOREIGN KEY(user_id) REFERENCES users (id)
);
CREATE TABLE telegram_accounts (
	id INTEGER NOT NULL, 
	telegram_id INTEGER NOT NULL, 
	crm_user_id INTEGER, 
	role VARCHAR(6) NOT NULL, 
	created_at DATETIME, 
	PRIMARY KEY (id), 
	FOREIGN KEY(crm_user_id) REFERENCES users (id)
);
CREATE TABLE client_requests (
	id INTEGER NOT NULL, 
	client_tg_id INTEGER NOT NULL, 
	status VARCHAR(6) NOT NULL, 
	created_at DATETIME, 
	taken_at DATETIME, 
	sales_tg_id INTEGER, 
	closed_at DATETIME, 
	lead_id INTEGER, 
	PRIMARY KEY (id), 
	FOREIGN KEY(lead_id) REFERENCES leads_prototype (id)
);
CREATE TABLE chat_messages (
	id INTEGER NOT NULL, 
	lead_id INTEGER NOT NULL, 
	source VARCHAR NOT NULL, 
	text VARCHAR NOT NULL, 
	sender_id INTEGER NOT NULL, 
	sender_role VARCHAR(6) NOT NULL, 
	created_at DATETIME NOT NULL, 
	is_from_sales BOOLEAN NOT NULL, 
	PRIMARY KEY (id), 
	FOREIGN KEY(lead_id) REFERENCES leads_prototype (id) ON DELETE CASCADE
);
CREATE TABLE draw_users (
	id INTEGER NOT NULL, 
	telegram_id INTEGER NOT NULL, 
	first_name VARCHAR, 
	last_name VARCHAR, 
	phone VARCHAR NOT NULL, 
	lang VARCHAR(2) NOT NULL, 
	created_at DATETIME, 
	PRIMARY KEY (id)
);
CREATE TABLE campaigns (
	id INTEGER NOT NULL, 
	name VARCHAR NOT NULL, 
	platform VARCHAR(9) NOT NULL, 
	account VARCHAR NOT NULL, 
	launch_date DATE NOT NULL, 
	end_date DATE NOT NULL, 
	planned_budget FLOAT NOT NULL, 
	spent_budget FLOAT NOT NULL, 
	views INTEGER NOT NULL, 
	clicks INTEGER NOT NULL, 
	leads_total INTEGER NOT NULL, 
	leads_active INTEGER NOT NULL, 
	status VARCHAR(9) NOT NULL, 
	created_at DATETIME, 
	updated_at DATETIME, 
	PRIMARY KEY (id)
);
CREATE TABLE residential_complexes (
	id INTEGER NOT NULL, 
	name VARCHAR NOT NULL, 
	slug VARCHAR, 
	city VARCHAR, 
	address VARCHAR, 
	description TEXT, 
	created_at DATETIME NOT NULL, 
	updated_at DATETIME, 
	PRIMARY KEY (id), 
	UNIQUE (name), 
	UNIQUE (slug)
);
CREATE TABLE apartment_units (
	id INTEGER NOT NULL, 
	complex_id INTEGER NOT NULL, 
	block_name VARCHAR NOT NULL, 
	unit_type VARCHAR, 
	status VARCHAR NOT NULL, 
	rooms INTEGER, 
	unit_number VARCHAR NOT NULL, 
	area_sqm FLOAT, 
	floor INTEGER NOT NULL, 
	raw_payload JSON, 
	created_at DATETIME NOT NULL, 
	updated_at DATETIME, 
	PRIMARY KEY (id), 
	CONSTRAINT uq_apartment_unit UNIQUE (complex_id, block_name, floor, unit_number), 
	FOREIGN KEY(complex_id) REFERENCES residential_complexes (id) ON DELETE CASCADE
);
CREATE TABLE chessboard_price_entries (
	id INTEGER NOT NULL, 
	complex_id INTEGER NOT NULL, 
	floor INTEGER NOT NULL, 
	category_key VARCHAR NOT NULL, 
	price_per_sqm FLOAT NOT NULL, 
	order_index INTEGER NOT NULL, 
	created_at DATETIME NOT NULL, 
	updated_at DATETIME, 
	PRIMARY KEY (id), 
	CONSTRAINT uq_chessboard_price_entry UNIQUE (complex_id, floor, category_key), 
	FOREIGN KEY(complex_id) REFERENCES residential_complexes (id) ON DELETE CASCADE
);
CREATE TABLE contract_registry_entries (
	id INTEGER NOT NULL, 
	complex_id INTEGER NOT NULL, 
	apartment_id INTEGER, 
	contract_number VARCHAR NOT NULL, 
	contract_date DATE NOT NULL, 
	block_name VARCHAR, 
	floor INTEGER, 
	apartment_number VARCHAR, 
	rooms INTEGER, 
	area_sqm FLOAT, 
	total_price FLOAT, 
	price_per_sqm FLOAT, 
	down_payment_percent FLOAT, 
	down_payment_amount FLOAT, 
	buyer_full_name VARCHAR NOT NULL, 
	buyer_passport_series VARCHAR, 
	buyer_pinfl VARCHAR, 
	issued_by VARCHAR, 
	registration_address TEXT, 
	phone_number VARCHAR, 
	sales_department VARCHAR, 
	extra_data JSON, 
	created_at DATETIME NOT NULL, 
	updated_at DATETIME, 
	PRIMARY KEY (id), 
	CONSTRAINT uq_contract_registry_contract UNIQUE (complex_id, contract_number), 
	FOREIGN KEY(complex_id) REFERENCES residential_complexes (id) ON DELETE CASCADE, 
	FOREIGN KEY(apartment_id) REFERENCES apartment_units (id) ON DELETE SET NULL
);
