CREATE UNIQUE INDEX ix_telegram_accounts_telegram_id ON telegram_accounts (telegram_id);
CREATE UNIQUE INDEX ix_draw_users_phone ON draw_users (phone);
CREATE UNIQUE INDEX ix_draw_users_telegram_id ON draw_users (telegram_id);
CREATE INDEX ix_comments_id ON comments (id);
CREATE INDEX ix_client_requests_client_tg_id ON client_requests (client_tg_id);
CREATE INDEX ix_chat_messages_lead_id ON chat_messages (lead_id);
CREATE INDEX ix_chat_messages_created_at ON chat_messages (created_at);
CREATE INDEX ix_chat_messages_is_from_sales ON chat_messages (is_from_sales);
CREATE INDEX ix_chat_messages_id ON chat_messages (id);
CREATE INDEX ix_apartment_units_complex_id ON apartment_units (complex_id);
CREATE INDEX ix_contract_registry_entries_complex_id ON contract_registry_entries (complex_id);
CREATE INDEX ix_contract_registry_entries_apartment_id ON contract_registry_entries (apartment_id);
